one.data.6 <- data.frame(revigo.data);
names(one.data.6) <- revigo.names;
one.data.6 <- one.data.6 [(one.data.6$plot_X != "null" & one.data.6$plot_Y != "null"), ];
one.data.6$plot_X <- as.numeric( as.character(one.data.6$plot_X) );
one.data.6$plot_Y <- as.numeric( as.character(one.data.6$plot_Y) );
one.data.6$log_size <- as.numeric( as.character(one.data.6$log_size) );
one.data.6$value <- as.numeric( as.character(one.data.6$value) );
one.data.6$frequency <- as.numeric( as.character(one.data.6$frequency) );
one.data.6$uniqueness <- as.numeric( as.character(one.data.6$uniqueness) );
one.data.6$dispensability <- as.numeric( as.character(one.data.6$dispensability) );
one.data.6$GO = "MF"
one.data.6$category = "non duplicated gene families"
one.data.6$label = ifelse(one.data.6$frequency > 0.02 & one.data.6$dispensability < 0.15, one.data.6$description, "")


one.data.all = rbind(one.data, one.data2, one.data.3, one.data.4, one.data.5, one.data.6)
colnames(one.data.all) = c("term_ID","description","frequency","plot_X","plot_Y","log_size","p_bonferroni","UserValue_0","uniqueness","dispensability","GO","category","label")

p1 <- ggplot( data = one.data.all );
p1 <- p1 + facet_grid(GO~category)
p1 <- p1 + geom_point( aes( plot_X, plot_Y, colour = p_bonferroni, size = frequency), alpha = I(0.6) );
p1 <- p1 + scale_colour_gradientn( colours = c("blue", "green", "yellow", "red"), limits = c( min(one.data.all$p_bonferroni), 0) );
p1 <- p1 + geom_point( aes(plot_X, plot_Y, size = frequency), shape = 21, fill = "transparent", colour = I (alpha ("black", 0.6) ));
p1 <- p1 + scale_size( range=c(2.5, 15)) + theme_bw(); # + scale_fill_gradientn(colours = heat_hcl(7), limits = c(-300, 0) );
p1 <- p1 + geom_label_repel(mapping = aes(plot_X, plot_Y, label = label), size = 3.5, max.overlaps = 100000 );
p1 <- p1 + labs (y = "semantic space x", x = "semantic space y")
